\":\"Wikimedia Commons\"},\"startDate\":\"6200\",\"headline\":\"Die erste Karte (6200 v. Chr.)\",\"text\":\"<p>Die lteste bekannte Karte stammt aus dem Jahr 6200 v. Chr. und zeigt die Siedlung <strong>atal Hyk</strong> und den Vulkan Hasan Dagi, beides in der heutigen Trkei. Bei der Wandmalerei handelt es sich wohl um die erste detaillierte Darstellung einer Siedlung, die sich als Stadtgrundriss deuten lsst (Kulturpool, 2016). Mittlerweile spricht man bei derartigen Karten von <em>Umweltsymbolisierungen</em>, da zur damaligen Zeit natrlich noch keine absoluten Angaben (z.B. bzgl. Distanzen) gemacht wurden. Die ersten kartenhnlichen Darstellungen stammen also evtl. aus einer Zeit, noch bevor die Schrift erfunden wurde (Dickmann, 2018).</p>\\n\"},{\"asset\":{\"thumbnail\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAACAAAAAgCAMAAABEpIrGAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAAyZpVFh0WE1MOmNvbS5hZG9iZS54bXAAAAAAADw/eHBhY2tldCBiZWdpbj0i77u/IiBpZD0iVzVNME1wQ2VoaUh6cmVTek5UY3prYzlkIj8+IDx4OnhtcG1ldGEgeG1sbnM6eD0iYWRvYmU6bnM6bWV0YS8iIHg6eG1wdGs9IkFkb2JlIFhNUCBDb3JlIDUuNi1jMTQyIDc5LjE2MDkyNCwgMjAxNy8wNy8xMy0wMTowNjozOSAgICAgICAgIj4gPHJkZjpSREYgeG1sbnM6cmRmPSJodHRwOi8vd3d3LnczLm9yZy8xOTk5LzAyLzIyLXJkZi1zeW50YXgtbnMjIj4gPHJkZjpEZXNjcmlwdGlvbiByZGY6YWJvdXQ9IiIgeG1sbnM6eG1wPSJodHRwOi8vbnMuYWRvYmUuY29tL3hhcC8xLjAvIiB4bWxuczp4bXBNTT0iaHR0cDovL25zLmFkb2JlLmNvbS94YXAvMS4wL21tLyIgeG1sbnM6c3RSZWY9Imh0dHA6Ly9ucy5hZG9iZS5jb20veGFwLzEuMC9zVHlwZS9SZXNvdXJjZVJlZiMiIHhtcDpDcmVhdG9yVG9vbD0iQWRvYmUgUGhvdG9zaG9wIENDIDIwMTggKFdpbmRvd3MpIiB4bXBNTTpJbnN0YW5jZUlEPSJ4bXAuaWlkOkM2QTk3QkU1NjMxOTExRUM5NzczRDRBODJBM0YxQjU5IiB4bXBNTTpEb2N1bWVudElEPSJ4bXAuZGlkOkM2QTk3QkU2NjMxOTExRUM5NzczRDRBODJBM0YxQjU5Ij4gPHhtcE1NOkRlcml2ZWRGcm9tIHN0UmVmOmluc3RhbmNlSUQ9InhtcC5paWQ6QzZBOTdCRTM2MzE5MTFFQzk3NzNENEE4MkEzRjFCNTkiIHN0UmVmOmRvY3VtZW50SUQ9InhtcC5kaWQ6QzZBOTdCRTQ2MzE5MTFFQzk3NzNENEE4MkEzRjFCNTkiLz4gPC9yZGY6RGVzY3JpcHRpb24+IDwvcmRmOlJERj4gPC94OnhtcG1ldGE+IDw/eHBhY2tldCBlbmQ9InIiPz6qVYR3A
